css:
atom-ternjs-reference > div > div,
atom-ternjs-rename > div > div {
  max-height: 180px;
  overflow-y: auto;
}
atom-ternjs-rename > div {
  padding: 0 0 20px 20px;
}
atom-ternjs-rename atom-text-editor {
  max-width: 30%;
}
atom-ternjs-rename .mt {
  margin-top: 10px;
}
atom-ternjs-reference > div,
atom-ternjs-rename > div {
  position: relative;
}
atom-ternjs-reference > div > div {
  padding: 0 20px 20px 20px;
}
atom-ternjs-reference ul {
  list-style: none;
  padding-left: 0;
}
atom-ternjs-reference li {
  cursor: pointer;
  padding: 6px 0;
}
atom-ternjs-reference li:hover {
  background: rgba(100, 100, 100, 0.3);
}
atom-ternjs-reference h3 {
  margin: 0;
}
atom-ternjs-reference h3 > span {
  display: block;
  float: left;
}
atom-ternjs-reference h3 > span:first-child {
  width: 70%;
}
atom-ternjs-reference h3 > span:nth-child(2) {
  width: 30%;
  text-align: right;
}
atom-ternjs-reference .clear {
  clear: left;
}
atom-ternjs-reference strong {
  color: #5293d8;
}
atom-ternjs-reference .darken {
  color: #000000;
}
atom-ternjs-type {
  background: rgba(244, 244, 244, 0.9);
  border: 1px solid rgba(238, 238, 238, 0.2);
  color: #333333;
  border-radius: 2px;
  padding: 5px;
  position: relative;
}
atom-ternjs-type span {
  display: inline-block;
  padding: 10px 0 0 0;
}
atom-ternjs-type .current-param {
  font-weight: 500;
  color: #111111;
}
atom-text-editor::shadow .atom-ternjs-definition-marker div {
  transition: opacity 0.75s ease;
  opacity: 0;
  background: rgba(255, 255, 255, 0.1);
  border-bottom: 4px solid #ff4800;
}
atom-text-editor::shadow .atom-ternjs-definition-marker.active div {
  opacity: 1;
}
.atom-ternjs-reference-close,
.atom-ternjs-rename-close {
  margin: 20px;
  position: absolute;
  right: 0;
  top: 0;
}
